import React, { Fragment } from 'react';
import PropTypes from 'prop-types';

export const CategoryCard = ({ data,image,category_name }) => {
  return (
    <Fragment>
      {
        // data &&
        <div id={'id' || data.category_id} className='col'>
          <div className='categbox'>
            <div className='img-bg'>
              <img
                src={'https://images.bewakoof.com/uploads/grid/app/bewakoof-online-fashion-COTM-arced-green-msite-highlight-box-1612088826.jpg' || 'image/home/categ/img4.png'}
                className='img-fluid mx-auto'
                alt='Speakers'
              />
            </div>
            <p >{'Design of the day' || data.category_name}</p>
          </div>
        </div>
      }
    </Fragment>
  );
};

CategoryCard.propTypes = {
  data: PropTypes.array
};
